{% block body %}
\t<section class=\"nav-principal-body nav-body-rythme\">
\t\t<div class=\"row button-principal-body element-to-scroll\">
\t\t\t<div class=\"description-menu-button-page col-12\" style=\"margin-bottom: 10%\">
\t\t\t\t<h2 style=\"font-size: 3rem; width: 100%;\">Il est essentiel de passer du temps avec la famille, les<br>amis et de rencontrer d'autres personnes.<br>J'indique dans cette page uniquement mes activités<br>sociales programmées avec une frequence régulière.</h2>
\t\t\t</div>
\t\t\t<div class=\"menu-principal-body block-rythme\">
\t\t\t\t<div class=\"col-4 button-menu-icon responsive-top-border\" style=\"border: none;\">
\t\t\t\t\t<img src=\"{{ asset('img/picto-reunion-famille.png') }}\">
\t\t\t\t\t<a class=\"container-relative button-rythme\" href=\"{{ path('app_lien_sociaux', {'type': 'reunion_famille'}) }}\" style=\"background: #F14C4C; font-size: 1.8rem\">Réunion & Repas
\t\t\t\t\t\t<br>
\t\t\t\t\t\tde famille
\t\t\t\t\t\t<div class=\"info-bubble-ob\">
\t\t\t\t\t\t\tEst ce que je programme à une fréquence régulière<br>
\t\t\t\t\t\t\tdes réunions, repas ou occasions spéciales en famille ?
\t\t\t\t\t\t</div>
\t\t\t\t\t</a>
\t\t\t\t</div>
\t\t\t\t<div class=\"col-4 plus_moins container-relative\">
\t\t\t\t\t{% if countStatutReunionF == 0 %}
\t\t\t\t\t\t<a><img style=\"width: 150%\" src=\"{{ asset('img/picto-a-saisir.png') }}\"></a>
\t\t\t\t\t{% elseif countStatutReunionF < 3 %}
\t\t\t\t\t\t<a><img style=\"width: 150%\" src=\"{{ asset('img/saisit-en-partie.png') }}\"></a>
\t\t\t\t\t{% else %}
\t\t\t\t\t\t<a><img style=\"width: 150%\" src=\"{{ asset('img/picto-saisit') }}\"></a>
\t\t\t\t\t{% endif %}
\t\t\t\t\t<div class=\"info-bubble\">
\t\t\t\t\t\t{% if countStatutReunionF < 3 %}
\t\t\t\t\t\t\tRubrique saisit en partie
\t\t\t\t\t\t{% elseif countStatutReunionF == 0 %}
\t\t\t\t\t\t\tRubrique à saisir
\t\t\t\t\t\t{% else %}
\t\t\t\t\t\t\tRubrique complétée
\t\t\t\t\t\t{% endif %}
\t\t\t\t\t</div>
\t\t\t\t</div>
\t\t\t\t<div class=\"col-7 container-statistique\">
\t\t\t\t\t<a class=\"button-statistique\" style=\"position: relative;\">
\t\t\t\t\t\t<p class=\"title-statistique\">Ma routine cible
